import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import './App.css';  // Подключаем стили

const Home = () => {
  return (
    <div className="main">
      <div>
        <h1>Healthy Diet <br /> Everyday</h1>
        <p>Order today and receive your <br /> package tomorrow</p>
        <input type="submit" value="View Menu" />
        <input type="submit" value="Book a Table" />
        <h3>Breakfast</h3>
        <h5>9:00 am - 11:00 am →</h5>
      </div>
      <figure>
        <img src="assets/images/pasta2.avif" alt="Food" />
      </figure>
    </div>
  );
};

const Menu = () => <div>Menu Page</div>;
const About = () => <div>About Page</div>;
const Contact = () => <div>Contact Page</div>;

const App = () => {
  return (
    <Router>
      <div>
        <nav className="menu">
          <h3>Foodie</h3>
          <ul>
            <li><Link to="/">Home</Link></li>
            <li><Link to="/menu">Menu</Link></li>
            <li><Link to="/about">About</Link></li>
            <li><Link to="/contact">Contact</Link></li>
          </ul>
        </nav>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/menu" element={<Menu />} />
          <Route path="/about" element={<About />} />
          <Route path="/contact" element={<Contact />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
